import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import UserProvider from './shared/context/auth-context';

import './index.css';

ReactDOM.render(
  <UserProvider>
    <App />
  </UserProvider>,
  document.getElementById('root')
);
